import { create } from "apisauce";

const endpoint = "/login";
const api = create({
  baseURL: "http://192.168.0.14:9000/api",
});

const checkLogin = () => api.get(endpoint);
const cookie = CookieService.get("access_token");

// const token = {
//   headers: {
//     Accept: "application/json",
//     "Content-type": "application/json",
//     Authorization: "Bearer " + cookie,
//   },
// };

export default {
  checkLogin,
  register: (register) => axios.post(`${baseURL}/register`, register),

  details: () => axios.get(`${baseURL}/details`, token),

  logout: () => axios.get(`${baseURL}/logout`, token),

  createPost: (post) => axios.post(`${baseURL}/unicorns`, post, token),
};
